import RecipesByIngredientsList from './recipesbyingredientslist.js';

const ReturnAllRecipesFromIngredient = (props) => {

    const listRecipes = props.recipesByIngredient.map((recipe) =>
        <RecipesByIngredientsList recipesInfo={props.recipesByIngredient}/>
    );

    return(
        <div>
            {listRecipes}
        </div>
    )
}

export default ReturnAllRecipesFromIngredient
